import React from 'react'
import Navbar from './Navbar';
import Hero from './HeroMain';
import Keynotes from './Keynotes';
import Footer from './Footer';
function Home() {
  return (
    <div>
    <Navbar />
    <HeroMain />
    <Hero />
    <Keynotes />
    <Footer />
    </div>
  )
}

export default Home
